const ratingImages = {
    1: 'data:image/jpeg;base64,',
    2: 'data:image/jpeg;base64,',
    3:'data:image/jpeg;base64,'
};

function generatePDF() {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();
     // Load the letterhead image (replace with your letterhead image path or base64 string)
     const letterheadImg =  'data:image/jpeg;base64,'; // Example base64 image // Example base64 image

// Add the letterhead image to the PDF
doc.addImage(letterheadImg, 'JPEG', 5, 5, 200, 20); // Adjust positioning and size as needed





    const RegistrationNumber = document.getElementById('RegistrationNumber').value;
    const MODEL = document.getElementById('MODEL').value;

    const transmission = document.getElementById('transmission').value;
    const odometer =document.getElementById('odometer').value;
    const color =document.getElementById('Colour').value;
    const fuel =document.getElementById('fuel').value;
    const insurance =document.getElementById('insurance').value;
    const chassisNumber =document.getElementById('chassisNumber').value;
    const Year =document.getElementById('year').value;
    const HPAStatus =document.getElementById('hpaStatus').value;

    //new add//
    const ManufacturingMonthYear =document.getElementById('manufacturingDate').value;
    const ratingValue = document.getElementById('rating').value;
    const carImage = document.getElementById('carImage').files[0];

    if (!carImage) {
        alert('Please upload an image.');
        return;
    }



    const reader = new FileReader();

    reader.onload = function(event) {
        // Add registration name to PDF
        doc.text(5, 30, `RegistrationNumber: ${RegistrationNumber}`);

        doc.text(5, 40, `MODEL: ${MODEL}`);

        doc.text(5,50,`Odometer: ${odometer}`);
        doc.text(5,60,`Colour: ${color}`);
        doc.text(5,70,`fuel: ${fuel}`);
        doc.text(5,80,`Transmition: ${transmission}`);
        doc.text(5,90,`chassisNumber: ${chassisNumber}`);
       
       
        doc.text(5,100,`insurance: ${insurance}`);
        doc.text(5,110,`HPAStatus: ${hpaStatus}`);
        doc.text(5,120,`year: ${Year}`);
        doc.text(5,130,`ManufacturingMonthYear: ${manufacturingDate}`)
     
        // Add uploaded image to PDF
        doc.addImage(event.target.result, 'JPEG', 130, 30, 60, 60);

        // Add the rating image based on selected rating
        const ratingImage = ratingImages[ratingValue];
        
        if (ratingImage) {
            doc.addImage(ratingImage, 'JPEG', 130, 95, 90, 60);
        } else {
            doc.text(20, 140, 'Rating image not found.');
        }
        doc.addPage();

        // Save the PDF
        doc.save('car_registration.pdf');
    };

    reader.readAsDataURL(carImage);
}
